  false,\n\t\"url\": null,\n\t\"notes\": \"XBT data were collected during a Pacific
  Islands Fisheries Science Center's Cetacean Research Program's shipboard cetacean
  survey (Cruise ID SE 13-03). XBT casts were conducted three times each day (morning,
  midday, afternoon) along the transect lines within the Papahanaumokuakea Marine
  National Monument. If wind and swell conditions prevented a CTD cast, an XBT cast
  was conducted. Lockheed Martin Sippican Deep Blue XBTs were used. The terminal depth
  is 760 m.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
